Category Feature

Director Robby D 
Starring Janie Summers, Manuel Ferrara, Mick Blue, Diamond Foxxx, Ben English, Breanne Benson, Cindy Hope 

Roommate hunting in the Hollywood Hills starts off as a challenge for Mick and Manuel, but as soon as they interview sexy masseuse Janie Summers, everything takes a turn for the better! The guys invite Janie to become a roommate, she gets right to working out all their tension and sets a new standard for life in the hills. These roommates surely know how to let loose and enjoy life! 


